Zat√≠m jsme ve≈°ker√Ω k√≥d psali pouze na jedno m√≠sto v programu, do "mainu" . Jakmile programy zaƒçnou b√Ωt vƒõt≈°√≠ a vƒõt≈°√≠, tak zaƒçne tak√© b√Ωt neust√°le tƒõ≈æ≈°√≠ a tƒõ≈æ≈°√≠ se v nich zorientovat a udr≈æet je cel√© v hlavƒõ, abychom nad nimi mohli p≈ôem√Ω≈°let. Z√°rove≈à se n√°m v programu brzy zaƒçnou objevovat √∫seky k√≥du, kter√© jsou t√©mƒõ≈ô toto≈æn√©, ale li≈°√≠ se v drobn√Ωch detailech. Chtƒõli bychom tak m√≠t mo≈ænost takov√Ωto k√≥d napsat pouze jednou a tyto mƒõn√≠c√≠ se detaily do nƒõj pouze "dosadit". K rozdƒõlen√≠ k√≥du programu do sady ucelen√Ωch ƒç√°st√≠ a jejich parametrizaci slou≈æ√≠ funkce ( functions ). Funkce je pojmenovan√Ω blok k√≥du, na kter√Ω se m≈Ø≈æeme odk√°zat v jin√© ƒç√°sti programu a vykonat tak k√≥d, kter√Ω se ve funkci nach√°z√≠. S jednou funkc√≠ u≈æ jsme se setkali. Jedn√° se o funkci main, jej√≠≈æ k√≥d je proveden p≈ôi spu≈°tƒõn√≠ programu. My si nicm√©nƒõ m≈Ø≈æeme vytvo≈ôit vlastn√≠ funkce. Zde je p≈ô√≠klad vytvo≈ôen√≠, tj. definice ( definition ) jednoduch√© funkce s n√°zvem [1] vypis_text: void vypis_text() { printf("Ahoj\n");
