Kdy≈æ u≈æ m√°me v ukazateli ulo≈æenou nƒõjakou (validn√≠) adresu v pamƒõti, tak k t√©to pamƒõti m≈Ø≈æeme p≈ôistoupit pomoc√≠ oper√°toru dereference . Ten m√° syntaxi *<v√Ωraz typu ukazatel>. P≈ôi pou≈æit√≠ tohoto oper√°toru na ukazateli program p≈ôeƒçte adresu v ukazateli, pod√≠v√° se do pamƒõti a naƒçte hodnotu ulo≈æenou na t√©to adrese. Podle toho, na jak√Ω datov√Ω typ ukazatel ukazuje, se naƒçte odpov√≠daj√≠c√≠ poƒçet byt≈Ø z pamƒõti: #include <stdio.h> int main() { int cislo = 1; int* ukazatel = &cislo; printf("%p\n", ukazatel); printf("%d\n", *ukazatel); printf("%d\n", cislo); return 0;
