129.body:
Abychom se mohli v pamƒõti "posouvat" o urƒçit√Ω kus dop≈ôedu ƒçi dozadu (relativnƒõ k nƒõjak√© adrese), m≈Ø≈æeme k ukazatel≈Øm p≈ôiƒç√≠tat ƒçi odƒç√≠tat ƒç√≠sla. Toto se oznaƒçuje jako aritmetika s ukazateli ( pointer arithmetic ). Tato aritmetika m√° d≈Øle≈æit√© pravidlo ‚Äì pokud k ukazateli na konkr√©tn√≠ datov√Ω typ p≈ôiƒçteme hodnotu n, tak se adresa v ukazateli zv√Ω≈°√≠ o n-n√°sobek velikosti datov√©ho typu, na kter√Ω ukazatel ukazuje. P≈ôi aritmetice s ukazateli se tak neposouv√°me po jednotliv√Ωch bytech, ale po cel√Ωch hodnot√°ch dan√©ho datov√©ho typu [4] . Z toho vypl√Ωv√°, ≈æe aritmetiku nem≈Ø≈æeme prov√°dƒõt nad ukazateli typu void*, proto≈æe ty neukazuj√≠ na ≈æ√°dn√Ω konkr√©tn√≠ datov√Ω typ. Nap≈ô√≠klad, pokud bychom mƒõli ukazatel int* p s hodnotou 16 (tj. "ukazuje" na adresu 16) a velikost intu by byla 4, tak v√Ωraz p + 1 bude ukazatel s hodnotou 20, v√Ωraz p + 2 bude ukazatel s adresou 24 atd. Je d≈Øle≈æit√© rozli≈°ovat , jestli p≈ôi pou≈æit√≠ sƒç√≠t√°n√≠/odƒç√≠t√°n√≠ pracujeme s hodnotou ukazatele anebo s hodnotou na adrese, kter√° je v ukazateli ulo≈æena: int x = 1;
int* p = &x; *p += 1; // zv√Ω≈°ili jsme hodnotu na adrese v `p` (tj. promƒõnnou `x`) o `1`
p += 1; // zv√Ω≈°ili jsme adresu v `p` o `4` (tj. p nyn√≠ u≈æ neukazuje na `x`) K ƒçemu je aritmetika s ukazateli u≈æiteƒçn√° se dozv√≠te v sekci o pr√°ci s v√≠ce promƒõnn√Ωmi z√°rove≈à . Kromƒõ dereference a aritmetiky lze s ukazateli prov√°dƒõt tak√© porovn√°v√°n√≠ (klasicky pomoc√≠ oper√°toru ==). D√≠ky tomu m≈Ø≈æeme zjistit, jestli se dvƒõ adresy rovnaj√≠.

130.body:
Jak se dozv√≠te v n√°sleduj√≠c√≠ sekci , ukazatele jsou nezbytn√© pro dynamickou alokaci pamƒõti. Hod√≠ se tak√© p≈ôi pr√°ci s v√≠ce promƒõnn√Ωmi z√°rove≈à. Kromƒõ toho je ale lze pou≈æ√≠t tak√© nap≈ô√≠klad v n√°sleduj√≠c√≠ch situac√≠ch, kter√© v≈°echny souvis√≠ s p≈ôed√°v√°n√≠m adres (ukazatel≈Ø) do funkc√≠: Zmƒõna vnƒõj≈°√≠ch hodnot zevnit≈ô funkce Hodnoty argument≈Ø p≈ôed√°van√Ωch p≈ôi vol√°n√≠ funkc√≠ se do funkce kop√≠ruj√≠, nelze tak jednodu≈°e zevnit≈ô funkce mƒõnit hodnoty promƒõnn√Ωch, kter√© existuj√≠ mimo danou funkci. To je sice samo o sobƒõ vhodn√° vlastnost, proto≈æe pokud bude funkce mƒõnit pouze sv√© lok√°ln√≠ promƒõnn√©, p≈ô√≠padnƒõ parametry, tak bude jednodu≈°≈°√≠ se v n√≠ vyznat. Nicm√©nƒõ, nƒõkdy opravdu chceme ve funkci zmƒõnit hodnoty extern√≠ch promƒõnn√Ωch. Toho m≈Ø≈æeme dos√°hnout tak, ≈æe si do funkce m√≠sto hodnoty promƒõnn√© po≈°leme jej√≠ adresu v ukazateli, a pomoc√≠ t√©to adresy pak hodnotu promƒõnn√© zmƒõn√≠me. Takto nap≈ô√≠klad m≈Ø≈æeme vytvo≈ôit funkci, kter√° vezme adresy dvou promƒõnn√Ωch a prohod√≠ jejich hodnoty: #include <stdio.h> void vymen(int* a, int* b) { int docasna_hodnota = *a; // naƒçti hodnotu na adrese v `a` *a = *b; // naƒçti hodnotu na adrese v `b` a ulo≈æ ji na adresu v `a` *b = docasna_hodnota; // ulo≈æ ulo≈æenou hodnotu na adresu v `b`
}
int main() { int x = 5; int y = 10; vymen(&x, &y); printf("Po prehozeni: x=%d, y=%d\n", x, y); return 0;
} Interaktivn√≠ vizualizace k√≥du Vr√°cen√≠ v√≠ce n√°vratov√Ωch hodnot Pos√≠l√°n√≠ adres promƒõnn√Ωch do funkce m≈Ø≈æeme vyu≈æ√≠t tak√© k tomu, abychom z funkce vr√°tili v√≠ce ne≈æ jednu n√°vratovou hodnotu (do adres ulo≈æen√Ωch v parametrech toti≈æ m≈Ø≈æeme zapsat "n√°vratov√©" hodnoty). Toho bychom v≈°ak mƒõli vyu≈æ√≠vat pouze, pokud je to opravdu nezbytn√©. Takov√©to funkce je toti≈æ slo≈æitƒõj≈°√≠ volat a nejsou ƒçist√© , proto≈æe obsahuj√≠ vedlej≈°√≠ efekt - mƒõn√≠ extern√≠ stav programu. #include <stdio.h> void vrat_dve_hodnoty(int* a, int* b) { *a = 5; *b = 6;
} int main() { int a = 0; int b = 0; vrat_dve_hodnoty(&a, &b); printf("a=%d, b=%d\n", a, b); return 0;
} Sd√≠len√≠ hodnot bez kop√≠rov√°n√≠ Pokud bychom mƒõli promƒõnn√©, kter√© v pamƒõti zab√≠raj√≠ velk√© mno≈æstv√≠ byt≈Ø (nap≈ô√≠klad struktury ), a p≈ôed√°vali je jako argumenty funkci, tak m≈Ø≈æe b√Ωt zbyteƒçnƒõ pomal√© je poka≈æd√© kop√≠rovat. Pokud do funkce pouze p≈ôed√°me jejich adresu, tak dojde ke kopii pouze jednoho ƒç√≠sla s adresou, nez√°visle na tom, jak velk√° je promƒõnn√°, kter√° je na dan√© adrese ulo≈æena. Ukazatele tak m≈Ø≈æeme pou≈æ√≠t ke sd√≠len√≠ hodnot v pamƒõti mezi funkcemi bez toho, abychom je kop√≠rovali.

