Pokud byste chtƒõli vytvo≈ôit v√≠ce ukazatel≈Ø najednou , mus√≠te si d√°t pozor na to, ≈æe v tomto p≈ô√≠padƒõ se hvƒõzdiƒçka vztahuje pouze k jednomu n√°sleduj√≠c√≠mu n√°zvu promƒõnn√©. Tento k√≥d tak vytvo≈ô√≠ ukazatel s n√°zvem x, a dvƒõ cel√° ƒç√≠sla s n√°zvy y a z: int* x, y, z; Pokud byste chtƒõli vytvo≈ôit t≈ôi ukazatele, mus√≠te d√°t hvƒõzdiƒçku p≈ôed ka≈æd√Ω n√°zev promƒõnn√©: int* x, *y, *z; Kv√≠z ü§î Co vyp√≠≈°e n√°sleduj√≠c√≠ program? #include <stdio.h> int main() { int a = 2; int* p = &a; p = 5; printf("%d\n", a); return 0;
