} Odpovƒõƒè Program vyp√≠≈°e a = 2, b = 4. Nejprve jsme sice nastavili ukazatel p na adresu promƒõnn√© a, ale pot√© jsme do p zapsali adresu promƒõnn√© b. ≈ò√°dek *p += 1; tak zvedne hodnotu v pamƒõti na adrese, kde le≈æ√≠ b, o jedniƒçku, jinak ≈ôeƒçeno zv√Ω≈°√≠ hodnotu promƒõnn√© b o jedniƒçku. Co vyp√≠≈°e n√°sleduj√≠c√≠ program? #include <stdio.h> void zmen_ukazatel(int* p, int a) { p = &a;
} int main() { int a = 2; int b = 3; int* p = &b; zmen_ukazatel(p, a); printf("%d\n", *p); return 0;
} Odpovƒõƒè Program vyp√≠≈°e 3. Kdy≈æ p≈ôed√°me argument typu ukazatele do funkce, tak stejnƒõ jako u jin√Ωch datov√Ωch typ≈Ø dojde k tomu, ≈æe se ve funkci vytvo≈ô√≠ nov√° promƒõnn√° a do n√≠ se nakop√≠ruje hodnota argumentu. Zmƒõna adresy v ukazateli p uvnit≈ô funkce zmen_ukazatel tak neovlivn√≠ adresu v ukazateli p uvnit≈ô funkce main. A jeliko≈æ p v mainu ukazuje na promƒõnnou b, tak dereference tohoto ukazatele se vyhodnot√≠ jako hodnota 3. Co vyp√≠≈°e n√°sleduj√≠c√≠ program? #include <stdio.h> int main() { int a = 2; int* p = &a; *p = 4; int b = *p; *p = 8; printf("a = %d, b = %d\n", a, b); return 0;
} Odpovƒõƒè Program vyp√≠≈°e a = 8, b = 4. P≈ôi vytv√°≈ôen√≠ promƒõnn√© b se hodnota na adrese ulo≈æen√© v ukazateli p ulo≈æ√≠ do b. V danou chv√≠li je na t√©to adrese ulo≈æena hodnota 4, proto se do promƒõnn√© b ulo≈æ√≠ pr√°vƒõ hodnota 4. Dal≈°√≠ zmƒõny hodnot na adrese ulo≈æen√© v p u≈æ promƒõnnou b neovlivn√≠. Co vyp√≠≈°e n√°sleduj√≠c√≠ program? #include <stdio.h> int main() { int a = 2; int* p = &a; printf("%d\n", p); return 0;
} Odpovƒõƒè Tento program obsahuje nedefinovan√© chov√°n√≠ üí£, proto≈æe jsme pou≈æili z√°stupn√Ω znak %d, kter√Ω slou≈æ√≠ k v√Ωpisu cel√Ωch ƒç√≠sel, ale p≈ôedali jsme funkci printf argument p, kter√Ω je datov√©ho typu ukazatel. Spr√°vnƒõ m≈Ø≈æeme buƒè pou≈æ√≠t z√°stupn√Ω znak %p, abychom vypsali adresu ulo≈æenou v ukazateli, nebo m≈Ø≈æeme pou≈æ√≠t dereferenci a vypsat hodnotu ulo≈æenou na adrese v ukazateli: printf("%p\n", p);
printf("%d\n", *p); Co vyp√≠≈°e n√°sleduj√≠c√≠ program? #include <stdio.h> int main() { int a = 2; int b = 3; int* p = &a; int** px = &p; *px = &b; *p = 8; printf("a = %d, b = %d\n", a, b); return 0;
