K ƒçemu vlastnƒõ ukazatel na funkce m≈Ø≈æe slou≈æit? U≈æ v√≠me, ≈æe pomoc√≠ funkc√≠ m≈Ø≈æeme parametrizovat k√≥d, co≈æ n√°m umo≈æ≈àuje pou≈æ√≠vat identick√Ω k√≥d nad r≈Øzn√Ωmi vstupn√≠mi hodnotami bez toho, abychom tento k√≥d museli neust√°le duplikovat. Prozat√≠m jsme pro parametrizaci pou≈æ√≠vali pouze jednoduch√© hodnoty, jako ƒç√≠sla nebo pravdivostn√≠ hodnoty. Pomoc√≠ ukazatel≈Ø na funkce v≈°ak m≈Ø≈æeme parametrizovat samotn√Ω k√≥d, kter√Ω se m√° uvnit≈ô nƒõjak√© funkce prov√©st. P≈ôedstavte si nap≈ô√≠klad, ≈æe chcete vytvo≈ôit funkci, kter√° provede nƒõjakou operaci (nap≈ô. p≈ôiƒçten√≠ konstanty, vyn√°soben√≠ konstantou nebo vyps√°n√≠ na v√Ωstup) s ƒç√≠slem, ale pouze v p≈ô√≠padƒõ, ≈æe toto ƒç√≠slo je kladn√©. V opaƒçn√©m p≈ô√≠padƒõ by mƒõla funkce toto ƒç√≠slo pouze vr√°tit, bez jak√©koliv zmƒõny. Jak byste tuto funkci napsali, bez toho, abyste ji duplikovali pro ka≈ædou operaci, kter√° se m√° s kladn√Ωm ƒç√≠slem prov√©st? Prvn√≠ ≈ôe≈°en√≠ by mohlo vypadat nap≈ô√≠klad takto: #include <stdio.h> int proved_pro_kladne(int cislo, int operace) { if (cislo <= 0) return cislo; if (operace == 0) { return cislo * 3; } else if (operace == 1) { return cislo + 1; } else { printf("Cislo: %d
", cislo); return cislo; }
} int main() { printf("%d
", proved_pro_kladne(-1, 0)); printf("%d
", proved_pro_kladne(1, 0)); printf("%d
", proved_pro_kladne(1, 1)); printf("%d
", proved_pro_kladne(1, 2)); return 0;
