Parametr size ud√°v√°, kolik byt≈Ø pamƒõti se m√° naalokovat. Tuto velikost m≈Ø≈æeme "tipnout" manu√°lnƒõ, nicm√©nƒõ to nen√≠ moc dobr√Ω n√°pad, proto≈æe bychom si museli pamatovat velikosti datov√Ωch typ≈Ø (p≈ôiƒçem≈æ jejich velikost se m≈Ø≈æe li≈°it v z√°vislosti na pou≈æit√©m operaƒçn√≠m syst√©mu ƒçi p≈ôekladaƒçi!). Abychom tomu p≈ôede≈°li, tak m≈Ø≈æeme pou≈æ√≠t oper√°tor sizeof, kter√©mu m≈Ø≈æeme p≈ôedat datov√Ω typ [2] . Tento v√Ωraz se pot√© vyhodnot√≠ jako velikost dan√©ho datov√©ho typu: #include <stdio.h>
int main() { printf("Velikost int je: %lu\n", sizeof(int)); printf("Velikost int* je: %lu\n", sizeof(int*)); return 0;
} P≈ô√≠padnƒõ v√Ωraz, v tom p≈ô√≠padƒõ si sizeof vezme jeho datov√Ω typ. N√°vratov√Ω typ void* reprezentuje ukazatel na libovoln√° data. Funkce malloc mus√≠ fungovat pro alokaci libovoln√©ho datov√©ho typu, proto mus√≠ m√≠t jako n√°vratov√Ω typ pr√°vƒõ univerz√°ln√≠ ukazatel void*. P≈ôi zavol√°n√≠ funkce malloc bychom mƒõli tento n√°vratov√Ω typ p≈ôetypovat na ukazatel na datov√Ω typ, kter√Ω alokujeme. P≈ôi zavol√°n√≠ mallocu dojde k naalokov√°n√≠ size byt≈Ø na haldƒõ. Adresa prvn√≠ho bytu t√©to naalokovan√© pamƒõti se pot√© vr√°t√≠ jako n√°vratov√° hodnota mallocu. Zde je uk√°zka programu, kter√Ω naalokuje pamƒõ≈• pro jeden int ve funkci, adresu naalokovan√© pamƒõti pot√© vr√°t√≠ jako n√°vratovou hodnotu a naalokovan√° pamƒõ≈• je pot√© p≈ôeƒçtena ve funkci main: #include <stdlib.h> int* naalokuj_pamet() { int* pamet = (int*) malloc(sizeof(int)); *pamet = 5; return pamet; }
