Hodnota zadan√° v hranat√Ωch z√°vork√°ch by mƒõla b√Ωt "konstantn√≠m v√Ωrazem", tj. buƒè p≈ô√≠mo ƒç√≠seln√° hodnota anebo ƒç√≠seln√° hodnota poch√°zej√≠c√≠ z makra [3] . Pokud budete pot≈ôebovat pole dynamick√© velikosti, tak byste mƒõli pou≈æ√≠t dynamickou alokaci pamƒõti . Dokonce ani konstantn√≠ promƒõnn√° nen√≠ v C "konstantn√≠m v√Ωrazem". Jazyk C od verze C99 ji≈æ sice povoluje d√°vat do hranat√Ωch z√°vorek i "dynamick√©" hodnoty, tj. v√Ωrazy, jejich≈æ hodnota nemus√≠ b√Ωt zn√°ma v dobƒõ p≈ôekladu: int velikost = ...; // velikost se naƒçte nap≈ô. ze souboru
int pole[velikost]; Tato funkcionalita zvan√° VLA (variable-length array) je nicm√©nƒõ urƒçen√° pro velmi specifick√© pou≈æit√≠ a nese s sebou r≈Øzn√© nev√Ωhody, proto ji v r√°mci p≈ôedmƒõtu UPR nepou≈æ√≠vejte . Pokud si chcete b√Ωt jisti, ≈æe se VLA ve va≈°em k√≥du nevyskytuje, p≈ôekl√°dejte sv√© programy s parametrem p≈ôekladaƒçe -Werror=vla. Proƒç ne VLA? Z√°sobn√≠k m√° znaƒçnƒõ omezenou velikost a nen√≠ urƒçen pro alokaci velk√©ho mno≈æstv√≠ pamƒõti [4] . Pokud velikost takov√©hoto pole m≈Ø≈æe ovlivnit u≈æivatel programu (nap≈ô. zad√°n√≠m vstupu), m≈Ø≈æe v√°≈° program jednodu≈°e "shodit" (v lep≈°√≠m p≈ô√≠padƒõ) nebo zp≈Øsobit p≈ôeps√°n√≠ existuj√≠c√≠ pamƒõti (v hor≈°√≠m p≈ô√≠padƒõ), pokud by zadal velk√© ƒç√≠slo a do≈°lo by k pokusu o vytvo≈ôen√≠ moc velk√©ho pole na z√°sobn√≠ku. VLA m√° tak√© r≈Øzn√© probl√©my s kompatibilitou mezi p≈ôekladaƒçi a jeho implementace p≈ôekladaƒçi nen√≠ zdaleka trivi√°ln√≠. Alokace pamƒõti s dynamickou velikost√≠ na z√°sobn√≠ku se m≈Ø≈æe hodit ve velmi specifick√Ωch p≈ô√≠padech, nap≈ô. p≈ôi v√Ωvoji embedded za≈ô√≠zen√≠ nebo p≈ôi vysoce efektivn√≠ pr√°ci s I/O (vstup/v√Ωstup). Nicm√©nƒõ pro √∫ƒçely bƒõ≈æn√©ho programov√°n√≠ v C a p≈ôedmƒõtu UPR rozhodnƒõ nen√≠ pot≈ôeba, proto se VLA pros√≠me zkuste vyhnout. M≈Ø≈æete si nap≈ô√≠klad zkusit p≈ôelo≈æit n√°sleduj√≠c√≠ program: int main() { int pole[10000000]; return 0;
} P≈ôi spu≈°tƒõn√≠ by mƒõl program selhat na pamƒõ≈•ovou chybu , i kdy≈æ v√°≈° poƒç√≠taƒç m√° pravdƒõpodobnƒõ v√≠ce ne≈æ 10000000 * 4 (cca 38 MiB) pamƒõti. Pokud chcete alokovat v√≠ce ne≈æ nƒõkolik stovek byt≈Ø, pou≈æijte radƒõji dynamickou alokaci na haldƒõ.

