Abychom vyu≈æili toho, ≈æe n√°m pole umo≈æ≈àuj√≠ vytvo≈ôit vƒõt≈°√≠ mno≈æstv√≠ pamƒõti najednou, mus√≠me m√≠t mo≈ænost p≈ôistupovat k jednotliv√Ωm prvk≈Øm v poli. K tomu m≈Ø≈æeme vyu≈æ√≠t ukazatel≈Ø . Promƒõnn√° pole se toti≈æ chov√° jako ukazatel na prvn√≠ prvek (prvek na nult√©m indexu!) dan√©ho pole, pomoc√≠ oper√°toru dereference tak k tomutu prvku m≈Ø≈æeme jednodu≈°e p≈ôistoupit: #include <stdio.h> int main() { int pole[3] = { 1, 2, 3 }; printf("%d
", *pole); return 0;
} Abychom p≈ôistoupili i k dal≈°√≠m prvk≈Øm v poli, tak m≈Ø≈æeme vyu≈æ√≠t aritmetiky s ukazateli . Pokud chceme z√≠skat adresu prvku na i-t√©m indexu, staƒç√≠ k ukazateli na prvn√≠ prvek p≈ôiƒç√≠st i [5] : #include <stdio.h> int main() { int pole[3] = { 1, 2, 3 }; printf("%d
", *(pole + 0)); // prvn√≠ prvek pole printf("%d
", *(pole + 1)); // druh√Ω prvek pole printf("%d
", *(pole + 2)); // t≈ôet√≠ prvek pole return 0;
