152.body:
Jeliko≈æ je operace p≈ô√≠stupu k poli ("posunut√≠" ukazatele a jeho dereference) velmi bƒõ≈æn√° (a z√°rove≈à relativnƒõ krkolomn√°), C obsahuje speci√°ln√≠ oper√°tor, kter√Ω ji zjednodu≈°uje. Tento oper√°tor se naz√Ωv√° array subscription operator a m√° syntaxi <v√Ωraz a>[<v√Ωraz b>] Slou≈æ√≠ jako zkratka [6] za v√Ωraz *(<v√Ωraz a> + <v√Ωraz b>) P≈ô√≠klad: pole[0] je ekvivalentn√≠ v√Ωrazu *(pole + 0) pole[5] je ekvivalentn√≠ v√Ωrazu *(pole + 5) int pole[3] = { 1, 2, 3 };
pole[0] = 5; // nastavili jsme prvn√≠ prvek pole na hodnotu `5`
int c = pole[2]; // nastavili jsme `c` na hodnotu posledn√≠ho (t≈ôet√≠ho) prvku pole Takov√©to "zkratky", kter√© v programovac√≠m jazyku nep≈ôin√°≈°√≠ novou funkcionalitu, pouze zkracuj√≠ ƒçi zjednodu≈°≈°uj√≠ ƒçasto pou≈æ√≠van√© kombinace p≈ô√≠kaz≈Ø, se oznaƒçuj√≠ jako syntactic sugar . Jeliko≈æ je pou≈æ√≠v√°n√≠ hranat√Ωch z√°vorek p≈ôehlednƒõj≈°√≠ ne≈æ pou≈æ√≠v√°n√≠ z√°vorek a hvƒõzdiƒçek, doporuƒçujeme je pou≈æ√≠vat pro p≈ôistupov√°n√≠ k prvk≈Øm pole, pokud to p≈Øjde. Pozor na rozd√≠l mezi t√≠mto oper√°torem a definic√≠ pole. Oboj√≠ sice pou≈æ√≠v√° hranat√© z√°vorky, ale jinak spolu tyto dvƒõ vƒõci nesouvisej√≠. Podobnƒõ jako se * pou≈æ√≠v√° pro definici datov√©ho typu ukazatele a z√°rove≈à jako oper√°tor dereference (nav√≠c i jako oper√°tor pro n√°soben√≠). V≈ædy z√°le≈æ√≠ na kontextu, kde jsou tyto znaky pou≈æity.

