U≈æ v√≠me, ≈æe kdy≈æ p≈ôed√°v√°me argumenty do funkc√≠, tak se jejich hodnota zkop√≠ruje. U statick√Ωch pol√≠ tomu tak ov≈°em nen√≠, proto≈æe pole m≈Ø≈æou b√Ωt potenci√°lnƒõ velmi velk√° a prov√°dƒõn√≠ kopi√≠ pol√≠ by tak potenci√°lnƒõ mohlo brzdit prov√°dƒõn√≠ programu. Kdy≈æ tak pou≈æijeme promƒõnnou pole jako argument p≈ôi vol√°n√≠ funkce, dojde k tzv. konverzi pole na ukazatel ( array to pointer decay ). Pole se tak v≈ædy p≈ôed√° jako ukazatel na jeho prvn√≠ prvek: #include <stdio.h> void vypis_pole(int* pole) { printf("%d\n", pole[0]);
