156.body:
Kdy≈æ ve funkci p≈ôijmeme jako parametr ukazatel na pole, tak nev√≠me, kolik prvk≈Ø v tomto poli je. Tato informace je ale stƒõ≈æejn√≠, bez n√≠ toti≈æ nev√≠me, ke kolika prvk≈Øm pole si m≈Ø≈æeme dovolit p≈ôistupovat. Pokud tedy ukazatel na pole p≈ôed√°v√°me do funkce, je obvykle pot≈ôeba z√°rove≈à s n√≠m p≈ôedat i d√©lku dan√©ho pole: int secti_pole(int* pole, int velikost) { int soucet = 0; for (int i = 0; i < velikost; i++) { soucet += pole[i]; } return soucet;
} V√Ωpoƒçet velikosti pole Abyste p≈ôi zmƒõnƒõ velikosti statick√©ho pole nemuseli ruƒçnƒõ jeho velikost upravovat na v√≠ce m√≠stech v k√≥du, tak m≈Ø≈æete ve funkci, kde definujete statick√© pole, vypoƒç√≠tat jeho velikost pomoc√≠ oper√°toru sizeof: int pole[3] = { 1, 2, 3 };
printf("Velikost pole v bytech: %lu\n", sizeof(pole)); Abyste zjistili poƒçet prvk≈Ø ve statick√©m poli, m≈Ø≈æete velikost v bytech vydƒõlit velikost√≠ ka≈æd√©ho prvku v poli: int pole[3] = { 1, 2, 3 };
