Dal≈°√≠ mo≈ænost√≠, jak p≈ôedat nƒõjak√Ω vstup va≈°emu programu, je p≈ôedat mu parametry p≈ôi spu≈°tƒõn√≠ v termin√°lu: $ ./program arg1 arg2 arg3 K tƒõmto p≈ôedan√Ωm ≈ôetƒõzc≈Øm pot√© lze p≈ôistoupit ve funkci main . Kv√≠z ü§î Co vyp√≠≈°e n√°sleduj√≠c√≠ program, pokud na vstup zad√°me 5? #include <stdio.h> int main() { int a; scanf("%d", a); printf("Hodnota: %d\n", a); return 0;
