} Odpovƒõƒè Tento program obsahuje nedefinovan√© chov√°n√≠ üí£. Sice spr√°vnƒõ do funkce scanf p≈ôed√°v√° adresu cel√©ho ƒç√≠sla, ale tato adresa je neinicializovan√°! Adresy p≈ôedan√© funkci scanf po form√°tovac√≠m ≈ôetƒõzci jsou v√Ωstupn√≠mu argumenty, jinak ≈ôeƒçeno do p≈ôedan√Ωch adres budou zaps√°ny hodnoty naƒçten√© ze vstupu. Mus√≠me tak do funkce p≈ôedat validn√≠ adresu na kus pamƒõti, kde je opravdu ulo≈æeno cel√© ƒç√≠slo, co≈æ v tomto p≈ô√≠padƒõ neplat√≠. Co vyp√≠≈°e n√°sleduj√≠c√≠ program, pokud na vstup zad√°me 5? #include <stdio.h> int main() { int a; scanf("%s", &a); printf("Hodnota: %d\n", a); return 0;
