Novak Je d≈Øle≈æit√© si uvƒõdomit, co znamen√° const char* jmeno = radek;. char* je ukazatel, tedy ƒç√≠slo obsahuj√≠c√≠ adresu. T√≠mto ≈ô√°dkem pouze ≈ô√≠k√°me, ≈æe do ukazatele s n√°zvem jmeno ukl√°d√°me adresu pole znak≈Ø radek. ≈ò√°dkem const char* prijmeni = radek; ≈ô√≠k√°me, ≈æe tuto adresu ukl√°d√°me do promƒõnn√© s n√°zvem prijmeni. Obƒõ dvƒõ promƒõnn√© (jmeno a prijmeni) tedy obsahuj√≠ stejnou adresu. No a jeliko≈æ si druh√Ωm vol√°n√≠m funkce fgets p≈ôep√≠≈°eme p≈Øvodn√≠ obsah pole radek, a obƒõ promƒõnn√© ukazuj√≠ na pole radek, tak se vyp√≠≈°e dvakr√°t posledn√≠ naƒçten√Ω ≈ô√°dek. Pozn√°mka: ve form√°tovac√≠m ≈ôetƒõzci funkce printf jsme zde nepou≈æili znak od≈ô√°dkov√°n√≠ (\n), proto≈æe funkce fgets jej ulo≈æ√≠ do pole radek a n√°≈° k√≥d ho zde neodstranil. Tak≈æe pokud bychom ho mƒõli i v printf, tak by se vypsaly dva znaky od≈ô√°dkov√°n√≠ za sebou.

